import React from 'react';

function ImagePopup() {
    return (
        <div className="popup popup_type-image-caption">
            <div className="popup__image-container">
                <img className="popup__caption-image" src="#" alt="фотография" />
                <h2 className="popup__caption-image-title">.</h2>
                <button className="popup__button-close" type="button"></button>
            </div>
        </div>
    )
}

export default ImagePopup;
